import React from 'react';
import './App.css';
import { Routes, Route } from 'react-router-dom';

// Mock data for tournaments
const mockTournaments = [
  {
    id: 1,
    title: "Mayez Championship 2025",
    type: "Championship",
    date: "June 15-18, 2025",
    location: "Las Vegas, NV",
    prize: "$50,000",
    participants: 128,
    status: "Upcoming",
    image: "https://images.pexels.com/photos/16074/pexels-photo.jpg",
    color: "from-red-600 to-red-800"
  },
  {
    id: 2,
    title: "Elite Pool Masters",
    type: "Masters",
    date: "July 10-12, 2025",
    location: "New York, NY",
    prize: "$35,000",
    participants: 64,
    status: "Registration Open",
    image: "https://images.unsplash.com/photo-1599685315659-bc876da49fe5",
    color: "from-blue-600 to-blue-800"
  },
  {
    id: 3,
    title: "Pro Series Finals",
    type: "Pro Series",
    date: "August 5-7, 2025",
    location: "Chicago, IL",
    prize: "$75,000",
    participants: 32,
    status: "Qualifiers Ongoing",
    image: "https://images.pexels.com/photos/10627147/pexels-photo-10627147.jpeg",
    color: "from-green-600 to-green-800"
  },
  {
    id: 4,
    title: "Women's Championship",
    type: "Women's Pro",
    date: "September 20-22, 2025",
    location: "Miami, FL",
    prize: "$40,000",
    participants: 64,
    status: "Coming Soon",
    image: "https://images.pexels.com/photos/2017868/pexels-photo-2017868.jpeg",
    color: "from-purple-600 to-purple-800"
  },
  {
    id: 5,
    title: "Seniors League Cup",
    type: "Seniors",
    date: "October 15-17, 2025",
    location: "Phoenix, AZ",
    prize: "$25,000",
    participants: 96,
    status: "Registration Open",
    image: "https://images.unsplash.com/photo-1575553939928-d03b21323afe",
    color: "from-orange-600 to-orange-800"
  },
  {
    id: 6,
    title: "Youth Championship",
    type: "Youth",
    date: "November 12-14, 2025",
    location: "Orlando, FL",
    prize: "$15,000",
    participants: 128,
    status: "Registration Open",
    image: "https://images.pexels.com/photos/6253681/pexels-photo-6253681.jpeg",
    color: "from-cyan-600 to-cyan-800"
  }
];

const mockRecommended = [
  {
    id: 1,
    title: "Mayez Pro Championship - Week 4",
    subtitle: "Elite Players Showcase",
    date: "June 25, 2025",
    time: "8:00 PM EST",
    image: "https://images.unsplash.com/photo-1641638066062-6ebb46f56c70",
    status: "Live"
  },
  {
    id: 2,
    title: "Masters Tournament Finals",
    subtitle: "Championship Showdown",
    date: "June 28, 2025",
    time: "7:30 PM EST",
    image: "https://images.pexels.com/photos/6253986/pexels-photo-6253986.jpeg",
    status: "Upcoming"
  },
  {
    id: 3,
    title: "Women's Elite Series - Semi Finals",
    subtitle: "Top 4 Compete",
    date: "June 30, 2025",
    time: "6:00 PM EST",
    image: "https://images.unsplash.com/photo-1556329754-9420aeb663c5",
    status: "Upcoming"
  },
  {
    id: 4,
    title: "Youth Championship Qualifier",
    subtitle: "Next Generation Stars",
    date: "July 2, 2025",
    time: "5:00 PM EST",
    image: "https://images.pexels.com/photos/3007388/pexels-photo-3007388.jpeg",
    status: "Registration"
  }
];

const mockVideos = [
  {
    id: 1,
    title: "Mayez Tournament Highlights - Episode 15",
    duration: "42:30",
    views: "125K",
    image: "https://images.unsplash.com/photo-1627257060697-acfbecf5d9a2",
    youtubeId: "dQw4w9WgXcQ"
  },
  {
    id: 2,
    title: "Pro Series Championship Final",
    duration: "35:45",
    views: "89K",
    image: "https://images.pexels.com/photos/6253979/pexels-photo-6253979.jpeg",
    youtubeId: "dQw4w9WgXcQ"
  },
  {
    id: 3,
    title: "Masters Tournament Best Shots",
    duration: "28:15",
    views: "156K",
    image: "https://images.pexels.com/photos/16074/pexels-photo.jpg",
    youtubeId: "dQw4w9WgXcQ"
  },
  {
    id: 4,
    title: "Behind the Scenes - Tournament Setup",
    duration: "18:20",
    views: "67K",
    image: "https://images.unsplash.com/photo-1599685315659-bc876da49fe5",
    youtubeId: "dQw4w9WgXcQ"
  }
];

// Navigation Component
export const Navigation = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const navItems = [
    'HOME', 'NEWS', 'TOURNAMENTS', 'CALENDAR', 'LIVE', 
    'PLAYERS', 'RULES', 'HISTORY', 'ABOUT'
  ];

  return (
    <nav className="bg-black/95 backdrop-blur-sm fixed w-full z-50 border-b border-gray-800 mt-2">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex align-items-center justify-between h-16">
          {/* Logo */}
          <div className="flex-shrink-0">
            <motion.div 
              className="text-white font-bold text-xl"
              whileHover={{ scale: 1.05 }}
            >
              MAYEZ<span className="text-red-500">TOURNAMENT</span>
            </motion.div>
          </div>

          {/* Desktop Navigation */}
          <div className="hidden md:block">
            <div className="ml-10 flex items-baseline space-x-4 align-items-center">
              {navItems.map((item, index) => (
                <motion.a
                  key={item}
                  href="#"
                  className="text-gray-300 hover:text-white px-3 py-2 text-sm font-medium transition-colors"
                  whileHover={{ y: -2 }}
                  initial={{ opacity: 0, y: -20 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ delay: index * 0.1 }}
                >
                  {item}
                </motion.a>
              ))}

              {/* Login/Register Buttons */}
              <div className="hidden md:flex items-center space-x-4">
                <button 
                  className="bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded-md text-sm font-medium transition-colors"
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.95 }}
                >
                  LOGIN
                </button>
                <button 
                  className="bg-red-600 hover:bg-red-700 text-white px-4 py-2 rounded-md text-sm font-medium transition-colors"
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.95 }}
                >
                  REGISTER
                </button>
              </div>
            </div>
          </div>

          {/* Mobile menu button */}
          <div className="md:hidden">
            <button
              onClick={() => setIsMenuOpen(!isMenuOpen)}
              className="text-gray-400 hover:text-white focus:outline-none focus:text-white"
            >
              <ChevronDown className={`h-6 w-6 transform transition-transform ${isMenuOpen ? 'rotate-180' : ''}`} />
            </button>
          </div>
        </div>

        {/* Mobile Navigation */}
        {isMenuOpen && (
          <motion.div 
            className="md:hidden"
            initial={{ opacity: 0, height: 0 }}
            animate={{ opacity: 1, height: 'auto' }}
            exit={{ opacity: 0, height: 0 }}
          >
            <div className="px-2 pt-2 pb-3 space-y-1 sm:px-3 bg-gray-900">
              {navItems.map((item) => (
                <a
                  key={item}
                  href="#"
                  className="text-gray-300 hover:text-white block px-3 py-2 text-base font-medium"
                >
                  {item}
                </a>
              ))}
              <div className="flex flex-col space-y-2 pt-4">
                <button className="bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded-md text-sm font-medium transition-colors">
                  LOGIN
                </button>
                <button className="bg-red-600 hover:bg-red-700 text-white px-4 py-2 rounded-md text-sm font-medium transition-colors">
                  REGISTER
                </button>
              </div>
            </div>
          </motion.div>
        )}
      </div>
    </nav>
  );
};

function App() {
  return (
    <div className="App">
      <Navigation />
    </div>
  );
}

export default App;
